module Eco1C1G2T2 (
    input wire TetR, 
    input wire LacI, 
    input wire ChemX, 
    output reg YFP, 
    output reg BFP
);
  always @(TetR or LacI or ChemX) begin
    if (TetR & LacI & ~ChemX) begin
      YFP = 1'b1;
      BFP = 1'b0;
    end else if (TetR & ChemX & LacI) begin
      YFP = 1'b0;
      BFP = 1'b1;
    end else begin
      YFP = 1'b0;
      BFP = 1'b0;
    end
  end
endmodule
